import React from 'react';
import * as FaIcons from 'react-icons/fa'



const CartWidget = () => {
    return (
        <div className="CartWidget">
           <ul>
               
               <li> 
                 <Link to="/"><FaIcons.FaHome/> Inicio</Link>
               </li>

           </ul>
          

        </div>


    )

    }

export default CartWidget
